def create_justice_equity_upgrade_en_app(theme_primary_hue: str = "indigo"):
    with gr.Blocks(theme=gr.themes.Soft(primary_hue=theme_primary_hue), css=css) as demo:
        # States
        username_state = gr.State(value=None)
        token_state = gr.State(value=None)
        team_state = gr.State(value=None)

        # --- 1. LOADING STATE ---
        with gr.Column(visible=True, elem_id="app-loader") as loader_col:
            gr.HTML("<div style='text-align:center; padding:100px;'><h2> Verifying Credentials...</h2></div>")

        # --- 2. AUTH FAILED STATE ---
        with gr.Column(visible=False, elem_id="auth-fail") as auth_fail_col:
            gr.HTML(
                """
                <div style='text-align:center; padding:100px; color: #EF4444;'>
                    <h2> Authentication Failed</h2>
                    <p style='font-size: 1.2em;'>We could not verify your session.</p>
                    <p>Please return to the login page and try again.</p>
                    <br/>
                    <a href='/login' style='background-color:#EF4444; color:white; padding:10px 20px; text-decoration:none; border-radius:5px;'>Go to Login</a>
                </div>
                """
            )

        # --- 3. MAIN APP STATE ---
        with gr.Column(visible=False) as main_app_col:

            # Module containers
            module_ui_elements = {}
            
            # Variables to hold module 0 outputs (needed for .load() later)
            # We initialize them here so they exist in scope even if loop fails (safety)
            dash_output = None
            lb_output = None

            for i, mod in enumerate(MODULES):
                with gr.Column(visible=(i==0), elem_id=f"mod-{i}") as mod_col:
                    gr.HTML(mod["html"])

                    # --- MODULE 0 PART 1: SCORE DASHBOARD ---
                    # We render the top dashboard BEFORE the buttons
                    if i == 0:
                        dash_output = gr.HTML()

                    # --- MODULE 2 SPECIFIC: INPUTS ---
                    # Inputs for the certificate generator usually go above the buttons
                    if i == 2:
                        name_input = gr.Textbox(label="Full Name for Certificate", placeholder="e.g. Jane Doe")
                        gen_btn = gr.Button(" Generate Your Certificate", variant="primary")
                        cert_display = gr.HTML(label="Official Certificate", visible=False)
                        share_row = gr.HTML(visible=False)

                        gen_btn.click(
                            create_cert_handler,
                            inputs=[name_input, username_state, token_state, team_state],
                            outputs=[cert_display, share_row]
                        )

                    # --- NAVIGATION BUTTONS ---
                    # These are now placed in the middle for Module 0, or bottom for others
                    with gr.Row():
                        btn_prev = gr.Button(" Previous", visible=(i > 0))
                        next_txt = "Next " if i < len(MODULES) - 1 else "Finish"
                        btn_next = gr.Button(next_txt, visible=(i < len(MODULES) - 1))

                    # --- MODULE 0 PART 2: LEADERBOARD ---
                    # We render the leaderboard AFTER the buttons
                    if i == 0:
                        lb_output = gr.HTML()

                    module_ui_elements[i] = (mod_col, btn_prev, btn_next)

            # --- NAVIGATION LOGIC ---
            for i in range(len(MODULES)):
                curr_col, prev_btn, next_btn = module_ui_elements[i]

                if i > 0:
                    prev_col = module_ui_elements[i-1][0]
                    def nav_back():
                        return gr.update(visible=False), gr.update(visible=True)
                    prev_btn.click(nav_back, None, [curr_col, prev_col])

                if i < len(MODULES) - 1:
                    next_col = module_ui_elements[i+1][0]
                    def nav_fwd():
                        return gr.update(visible=False), gr.update(visible=True)
                    next_btn.click(nav_fwd, None, [curr_col, next_col])

        # --- LOAD HANDLER ---
        def handle_load(req: gr.Request):
            success, user, token = _try_session_based_auth(req)
            
            # --- FAILURE LOGIC ---
            if not success:
                return (
                    None, None, None,           # States
                    gr.update(visible=False),   # Loader -> Hide
                    gr.update(visible=True),    # Auth Fail -> SHOW
                    gr.update(visible=False),   # Main App -> Hide
                    "", ""                      # Dashboard/Leaderboard HTML
                )

            # Fetch team/score data using the complex fetcher
            try:
                os.environ["MORAL_COMPASS_API_BASE_URL"] = DEFAULT_API_URL
                client = MoralcompassApiClient(api_base_url=DEFAULT_API_URL, auth_token=token)

                # Simple fetch to get team name
                _, simple_team = fetch_user_history(user, token)

                # Complex fetch for leaderboard logic
                data = get_leaderboard_data(client, user, simple_team)

                # Render App 2 Components for Module 0
                dashboard_html = render_top_dashboard(data)
                leaderboard_html = render_leaderboard_card(data, user, simple_team)
            except Exception as e:
                # Optional: Fallback if API fails even if Auth worked
                print(f"API Error: {e}")
                dashboard_html = "<div>Error loading data</div>"
                leaderboard_html = ""

            # --- SUCCESS LOGIC ---
            return (
                user, token, simple_team,  # States
                gr.update(visible=False),  # Loader -> Hide
                gr.update(visible=False),  # Auth Fail -> Hide
                gr.update(visible=True),   # Main App -> SHOW
                dashboard_html, leaderboard_html
            )

        demo.load(
            handle_load, 
            None,
            [
                username_state, 
                token_state, 
                team_state, 
                loader_col, 
                auth_fail_col,
                main_app_col, 
                dash_output, 
                lb_output
            ]
        )

    return demo

def launch_justice_equity_upgrade_en_app(share=False,
                           server_port=8080,
                           **kwargs):
    app = create_justice_equity_upgrade_en_app()
    app.launch(share=share,
               server_port=server_port,
               **kwargs)

if __name__ == "__main__":
    launch_justice_equity_upgrade_en_app(share=False, debug=True, height=1000)
